import imgFooter from "../../../assets/Home/"

function Footer() {
    return ( 
        <div className="footer-container">
        <div className="footer-parent">
            <img src={require("../../../assets/Home/shape-bg.png").default} alt="no internet connection"></img>
        </div>

        </div>
     );
}

export default Footer;
